    "comment": "do get character from input device",
    "desc": "get character from input device in practice this routine operates identically to the CHRIN routine, $FFCF, for all devices except for the keyboard. If the keyboard is the current input device this routine will get one character from the keyboard buffer. It depends on the IRQ routine to read the keyboard and put characters into the buffer. If the keyboard buffer is empty the value returned in the accumulator will be zero.",
